import './App.css';
import React, { useState } from "react";
import {BrowserRouter, Routes, Route} from 'react-router-dom';
import TdeeCalculator from './Components/TdeeCalculator';
import FoodDashBoardPage from './Components/FoodDashboardPage'
import Error from './Error';
import SearchFood from './Components/SearchFood';

function App() {
  const [foodItems, setFoodItems] = useState([])
  const [searchInput, setSearchInput] = useState("")

  console.log(foodItems)

  function changeSearch(e) {
    setSearchInput(e)
  }

  return (
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<FoodDashBoardPage foodItems={foodItems} setFoodItems={setFoodItems}/>} />
          <Route path="search_food" element={<SearchFood setFoodItems={setFoodItems} searchInput={searchInput} setSearchInput={setSearchInput} changeSearch={changeSearch} />} /> 
          <Route path="tdee_calculator" element={<TdeeCalculator />} />
          <Route path="*" element={<Error/>}/>
        </Routes>
      </BrowserRouter>

  );
}

export default App;
